pragma solidity ^0.5.16;

contract CoWorkingSpace {
    struct Booking {
        address user;
        uint256 date;
    }

    mapping(uint256 => Booking) public bookings;

    function bookRoom(uint256 _roomId, uint256 _date) public {
        require(bookings[_roomId].date != _date, "This room is already booked for the selected date.");

        bookings[_roomId] = Booking(msg.sender, _date);
    }

    function getBooking(uint256 _roomId) public view returns (address, uint256) {
        return (bookings[_roomId].user, bookings[_roomId].date);
    }
}
